+ (void)drawButtonWithLabelText: (NSString*)labelText
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Peach Rectangle Drawing
    UIBezierPath* peachRectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 55, 30)];
    [StyleKit.commsPeach setFill];
    [peachRectanglePath fill];


    //// Black Rectangle Drawing
    UIBezierPath* blackRectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 180, 25)];
    [StyleKit.commsBlack setFill];
    [blackRectanglePath fill];


    //// Text Drawing
    CGRect textRect = CGRectMake(0, 0, 180, 25);
    NSMutableParagraphStyle* textStyle = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
    textStyle.alignment = NSTextAlignmentCenter;

    NSDictionary* textFontAttributes = @{NSFontAttributeName: [UIFont fontWithName: @"TrebuchetMS-Bold" size: 24], NSForegroundColorAttributeName: StyleKit.commsLightGreen, NSParagraphStyleAttributeName: textStyle};

    CGFloat textTextHeight = [labelText boundingRectWithSize: CGSizeMake(textRect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: textFontAttributes context: nil].size.height;
    CGContextSaveGState(context);
    CGContextClipToRect(context, textRect);
    [labelText drawInRect: CGRectMake(CGRectGetMinX(textRect), CGRectGetMinY(textRect) + (CGRectGetHeight(textRect) - textTextHeight) / 2, CGRectGetWidth(textRect), textTextHeight) withAttributes: textFontAttributes];
    CGContextRestoreGState(context);
}

+ (void)drawBigLabelWithLabelText: (NSString*)labelText
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Black Rectangle Drawing
    UIBezierPath* blackRectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, -0.01, 100, 50)];
    [StyleKit.commsBlack setFill];
    [blackRectanglePath fill];


    //// Text Drawing
    CGRect textRect = CGRectMake(0, 0, 100, 50);
    NSMutableParagraphStyle* textStyle = NSMutableParagraphStyle.defaultParagraphStyle.mutableCopy;
    textStyle.alignment = NSTextAlignmentCenter;

    NSDictionary* textFontAttributes = @{NSFontAttributeName: [UIFont fontWithName: @"TrebuchetMS" size: 32], NSForegroundColorAttributeName: StyleKit.commsBlue, NSParagraphStyleAttributeName: textStyle};

    CGFloat textTextHeight = [labelText boundingRectWithSize: CGSizeMake(textRect.size.width, INFINITY)  options: NSStringDrawingUsesLineFragmentOrigin attributes: textFontAttributes context: nil].size.height;
    CGContextSaveGState(context);
    CGContextClipToRect(context, textRect);
    [labelText drawInRect: CGRectMake(CGRectGetMinX(textRect), CGRectGetMinY(textRect) + (CGRectGetHeight(textRect) - textTextHeight) / 2, CGRectGetWidth(textRect), textTextHeight) withAttributes: textFontAttributes];
    CGContextRestoreGState(context);
}

